import React from 'react';
import unknownLogo from '../../assets/face.jpeg'

const LogoComponent = ({ user, width = '200', height = '200' }) => (
  <>{user ? <img src={user.src} alt width={width} height={height} /> : <img src={unknownLogo} width={width} height={height} />}</>
);

export default LogoComponent;
